import React from "react";

function Navbar() {
	return (
		<div className="container">
			<div className="row">
				<div className="col-md-12">
                    <div className="navbar">
                        <img src="img/copy1.png"/>
                    </div>
				</div>
			</div>
		</div>
	);
}

export default Navbar;
